import React from "react";

const Stocks = () => {
  return (
    <div>
      <h1>Stocks </h1>

      <form>
        <h4>Amount at purchase</h4>
        <input type="Number" placeholder="Amt in nos"></input>
      </form>
    </div>
  );
};

export default Stocks;
